	/**
	 * 
	 * @Author:HaoMing(郝明)
	 * @Project_name:ipc_ty
	 * @Full_path:com.comm.util.UnicodeUtil.java
	 * @Date:@2016 2016-1-7 下午2:31:51
	 * @Return_type:String
	 * @Desc :原文转unicode码
	 */
	public static String strToUnicode(String unicodeStr) {
		char[] utfBytes = unicodeStr.toCharArray();
		String unicodeBytes = "";
		for (int byteIndex = 0; byteIndex < utfBytes.length; byteIndex++) {
			String hexB = Integer.toHexString(utfBytes[byteIndex]);
			if (hexB.length() <= 2) {
				hexB = "00" + hexB;
			}
			unicodeBytes = unicodeBytes + "\\u" + hexB;
		}
		// System.out.println("unicodeBytes is: " + unicodeBytes);
		return unicodeBytes;
	}

	/**
	 * 
	 * @Author:HaoMing(郝明)
	 * @Project_name:ipc_ty
	 * @Full_path:com.comm.util.UnicodeUtil.java
	 * @Date:@2016 2016-4-14 下午2:18:12
	 * @Return_type:String
	 * @Desc : 参杂unicode码和源码的str解析
	 */
	public static String unicodeToStr_za(String str) {
		if(str.contains("\\\\u")){
			str = str.replaceAll("\\\\u", "\\u");
		}
		StringBuilder sb = new StringBuilder();
		char[] char_array = str.toCharArray();

		for (int j = 0; j < char_array.length; j++) {
			if(char_array[j] == '\\'){
				if (j + 5 < str.length()) {
					sb.append((char) Integer.parseInt(str.substring(j + 2, j + 6), 16));
					j += 5;
				}
			}else{
				sb.append(char_array[j]);
			}
		}
		
		return sb.toString();
	}

	/**
	 * 
	 * @Author:HaoMing(郝明)
	 * @Project_name:ipc_ty
	 * @Full_path:com.comm.util.UnicodeUtil.java
	 * @Date:@2016 2016-1-7 下午2:32:17
	 * @Return_type:String
	 * @Desc :unicode码转源码
	 */
	
	// 中文转unicode
		public static String strToUnicode_za(String unicodeStr) {
			char[] utfBytes = unicodeStr.toCharArray();
			String unicodeBytes = "";
			for (int byteIndex = 0; byteIndex < utfBytes.length; byteIndex++) {
				String hexB = Integer.toHexString(utfBytes[byteIndex]);
				if (!isChinese(utfBytes[byteIndex])) {
					unicodeBytes += utfBytes[byteIndex];
					continue;
				}
				if (hexB.length() <= 2) {
					hexB = "00" + hexB;
				}
				unicodeBytes = unicodeBytes + "\\u" + hexB;
			}
			// System.out.println("unicodeBytes is: " + unicodeBytes);
			return unicodeBytes;
		}

		// 判断是否汉字
		public static boolean isChinese(char c) {
			boolean result = false;
			if (c >= 19968 && c <= 171941) {// 汉字范围 \u4e00-\u9fa5 (中文)
				result = true;
			}
			return result;
		}
